   "source": [
    "library(tidyverse)\n",
    "library(caret)  \n",
    "library(modelr) #\n",
    "\n",
    "# 1. Загрузка\n",
    "df <- read_csv2(\"/kaggle/input/basic-regression-learning-dataset/Students_Stats.csv\")\n",
    "\n",
    "# 2. EDA: Проверка влияния Is_hostel на Total_Use\n",
    "p1 <- df %>%\n",
    "  ggplot(aes(x = factor(Is_hostel), y = Total_Use, fill = factor(Is_hostel))) +\n",
    "  geom_boxplot() +\n",
    "  labs(title = \"Влияние проживания в общежитии на Total_Use\",\n",
    "       x = \"Is_hostel (0/1)\", y = \"Total_Use\")\n",
    "\n",
    "print(p1)\n",
    "\n",
    "# 3. Построение модели на полной выборке\n",
    "model_full <- lm(Phil ~ Total_Use + Age + Optimism + Is_hostel, data = df)\n",
    "\n",
    "summary(model_full)\n",
    "\n",
    "# 4. Оценка точности (на полной выборке - это \"оптимистичная\" оценка)\n",
    "metrics_full <- df %>%\n",
    "  add_predictions(model_full) %>%\n",
    "  summarise(\n",
    "    RMSE = sqrt(mean((Phil - pred)^2)),\n",
    "    MAE = mean(abs(Phil - pred)),\n",
    "    R2 = summary(model_full)$r.squared\n",
    "  )\n",
    "\n",
    "print(\"Метрики на полной выборке (Training Performance):\")\n",
    "print(metrics_full)\n"
   ]
  },
