   "source": [
    "set.seed(123)\n",
    "\n",
    "# Метод 1: 10-кратная кросс-валидация\n",
    "train_control_cv <- trainControl(method = \"cv\", number = 10)\n",
    "\n",
    "# Метод 2: Повторная 10-кратная кросс-валидация (3 повтора)\n",
    "train_control_repeated <- trainControl(method = \"repeatedcv\", number = 10, repeats = 3)\n",
    "\n",
    "# Обучение с CV (10-Fold)\n",
    "model_cv <- train(Phil ~ Total_Use + Age + Optimism + Is_hostel, \n",
    "                  data = df, \n",
    "                  method = \"lm\", \n",
    "                  trControl = train_control_cv)\n",
    "\n",
    "# Обучение с Repeated CV\n",
    "model_repeated <- train(Phil ~ Total_Use + Age + Optimism + Is_hostel, \n",
    "                        data = df, \n",
    "                        method = \"lm\", \n",
    "                        trControl = train_control_repeated)\n",
    "\n",
    "# Сбор результатов в одну таблицу\n",
    "results_comparison <- data.frame(\n",
    "  Method = c(\"Full Data (No CV)\", \"10-Fold CV\", \"Repeated 10-Fold CV\"),\n",
    "  RMSE = c(metrics_full$RMSE, model_cv$results$RMSE, model_repeated$results$RMSE),\n",
    "  R2 = c(metrics_full$R2, model_cv$results$Rsquared, model_repeated$results$Rsquared),\n",
    "  MAE = c(metrics_full$MAE, model_cv$results$MAE, model_repeated$results$MAE)\n",
    ")\n",
    "\n",
    "print(results_comparison)\n"
   ]
  },
