   "source": [
    "library(tidyverse)\n",
    "library(caret)\n",
    "library(corrplot)\n",
    "\n",
    "# 1. Загрузка (возможно, придется указать кодировку, так как в названиях песен бывают спецсимволы)\n",
    "df <- read_csv(\"/kaggle/input/most-streamed-spotify-songs-2024/Most Streamed Spotify Songs 2024.csv\")\n",
    "\n",
    "# 2. Чистка данных\n",
    "clean_numeric <- function(x) {\n",
    "  as.numeric(gsub(\",\", \"\", x))\n",
    "}\n",
    "\n",
    "df_clean <- df %>%\n",
    "  mutate(\n",
    "    `Spotify Streams` = clean_numeric(`Spotify Streams`),\n",
    "    `Spotify Playlist Count` = clean_numeric(`Spotify Playlist Count`),\n",
    "    `Spotify Playlist Reach` = clean_numeric(`Spotify Playlist Reach`),\n",
    "    `YouTube Views` = clean_numeric(`YouTube Views`),\n",
    "    `TikTok Posts` = clean_numeric(`TikTok Posts`),\n",
    "    `AirPlay Spins` = clean_numeric(`AirPlay Spins`)\n",
    "  ) %>%\n",
    "  drop_na(`Spotify Streams`, `Spotify Playlist Count`, `Spotify Playlist Reach`, `YouTube Views`)\n",
    "\n",
    "# 3. Матрица корреляций (чтобы выбрать лучшие 3 переменные наверняка)\n",
    "cor_matrix <- cor(df_clean %>% select(`Spotify Streams`, `Spotify Playlist Count`, `Spotify Playlist Reach`, `YouTube Views`, `TikTok Posts`, `AirPlay Spins`))\n",
    "corrplot(cor_matrix, method = \"number\", type = \"upper\")\n",
    "\n",
    "# Вывод топ-3 корреляций\n",
    "print(sort(cor_matrix[\"Spotify Streams\", ], decreasing = TRUE))\n"
   ]
  },
