   "source": [
    "library(tidyverse)\n",
    "library(caret)\n",
    "\n",
    "# 1. Загрузка и Чистка\n",
    "df <- read_csv(\"/kaggle/input/most-streamed-spotify-songs-2024/Most Streamed Spotify Songs 2024.csv\")\n",
    "\n",
    "clean_numeric <- function(x) {\n",
    "  as.numeric(gsub(\",\", \"\", x))\n",
    "}\n",
    "\n",
    "df_clean <- df %>%\n",
    "  mutate(\n",
    "    Streams = clean_numeric(`Spotify Streams`),\n",
    "    Count = clean_numeric(`Spotify Playlist Count`),\n",
    "    Reach = clean_numeric(`Spotify Playlist Reach`),\n",
    "    Views = clean_numeric(`YouTube Views`)\n",
    "  ) %>%\n",
    "  drop_na(Streams, Count, Reach, Views) %>%\n",
    "  filter(Streams > 0)\n",
    "\n",
    "# 2. Логарифмирование (важный трюк для данных с длинным хвостом)\n",
    "df_log <- df_clean %>%\n",
    "  mutate(\n",
    "    log_Streams = log1p(Streams),\n",
    "    log_Count = log1p(Count),\n",
    "    log_Reach = log1p(Reach),\n",
    "    log_Views = log1p(Views)\n",
    "  )\n",
    "\n",
    "# 3. Настройка формул (теперь работаем с логарифмами)\n",
    "formulas <- list(\n",
    "  M1 = \"log_Streams ~ log_Count\",\n",
    "  M2 = \"log_Streams ~ log_Reach\",\n",
    "  M3 = \"log_Streams ~ log_Views\",\n",
    "  M4 = \"log_Streams ~ log_Count + log_Reach\",\n",
    "  M5 = \"log_Streams ~ log_Count + log_Views\",\n",
    "  M6 = \"log_Streams ~ log_Reach + log_Views\",\n",
    "  M7 = \"log_Streams ~ log_Count + log_Reach + log_Views\"\n",
    ")\n",
    "\n",
    "# 4. Обучение\n",
    "set.seed(123)\n",
    "train_ctrl <- trainControl(method = \"cv\", number = 10)\n",
    "results <- data.frame()\n",
    "\n",
    "for (name in names(formulas)) {\n",
    "  model <- train(as.formula(formulas[[name]]), \n",
    "                 data = df_log, \n",
    "                 method = \"lm\", \n",
    "                 trControl = train_ctrl)\n",
    "  \n",
    "  results <- rbind(results, data.frame(\n",
    "    Model = name,\n",
    "    Variables = as.character(formulas[[name]])[3],\n",
    "    RMSE = model$results$RMSE,\n",
    "    R2 = model$results$Rsquared,\n",
    "    MAE = model$results$MAE\n",
    "  ))\n",
    "}\n",
    "\n",
    "results_sorted <- results %>% arrange(RMSE)\n",
    "print(results_sorted)\n"
   ]
  },
