   "source": [
    "# Обучаем финальную лучшую модель (M7) на всех данных\n",
    "final_model <- lm(log_Streams ~ log_Count + log_Reach + log_Views, data = df_log)\n",
    "\n",
    "summary(final_model)\n",
    "\n",
    "\n",
    "par(mfrow = c(2, 2))\n",
    "plot(final_model)\n",
    "\n",
    "\n",
    "example_track <- df_log[1, ]\n",
    "pred_log <- predict(final_model, newdata = example_track)\n",
    "pred_real <- expm1(pred_log) # expm1 - обратная функция к log1p\n",
    "\n",
    "print(paste(\"Реальные стримы:\", example_track$Streams))\n",
    "print(paste(\"Предсказанные стримы:\", round(pred_real)))\n"
   ]
  },
