    "# Y5 - это целевая переменная (0/1). Посмотрим распределение эмпатии для уволенных и оставленных.\n",
    "p1 <- df %>%\n",
    "  ggplot(aes(x = factor(Y5), y = Empathy, fill = factor(Y5))) +\n",
    "  geom_boxplot() +\n",
    "  labs(title = \"Связь Эмпатии и Решения об увольнении (Y5)\",\n",
    "       x = \"Уволить? (0/1)\", y = \"Уровень Эмпатии\")\n",
    "\n",
    "print(p1)\n",
    "\n",
    "# 3. Построение дерева решений (Y5 ~ Empathy) на полной выборке\n",
    "# Важно: Y5 должна быть фактором для классификации!\n",
    "df$Y5 <- factor(df$Y5)\n",
    "\n",
    "model_tree <- rpart(Y5 ~ Empathy, data = df, method = \"class\")\n",
    "\n",
    "# Визуализация дерева (чтобы понять логику: \"Если Эмпатия < X, то уволить\")\n",
    "print(model_tree)\n",
    "\n",
    "# 4. Оценка точности на полной выборке\n",
    "pred_full <- predict(model_tree, df, type = \"class\")\n",
    "conf_matrix <- confusionMatrix(pred_full, df$Y5)\n",
    "\n",
    "print(\"Точность на полной выборке:\")\n",
    "print(conf_matrix$overall[\"Accuracy\"])\n"
   ]
  },
