    "set.seed(123)\n",
    "\n",
    "# 1. Настройка контроля\n",
    "# Метод 1: 5-Fold CV\n",
    "ctrl_cv <- trainControl(method = \"cv\", number = 5)\n",
    "\n",
    "# Метод 2: Bootstrap (стандарт в caret - 25 повторов)\n",
    "ctrl_boot <- trainControl(method = \"boot\", number = 25)\n",
    "\n",
    "# 2. Обучение моделей\n",
    "# Важно указать method = \"rpart\"\n",
    "model_cv <- train(Y5 ~ Empathy, data = df, method = \"rpart\", trControl = ctrl_cv)\n",
    "model_boot <- train(Y5 ~ Empathy, data = df, method = \"rpart\", trControl = ctrl_boot)\n",
    "\n",
    "# 3. Сравнение результатов\n",
    "results <- data.frame(\n",
    "  Method = c(\"Full Data\", \"5-Fold CV\", \"Bootstrap\"),\n",
