    "    0.8042857, # Вставьте сюда точное число из предыдущего шага, если оно отличается\n",
    "    max(model_cv$results$Accuracy),\n",
    "    max(model_boot$results$Accuracy)\n",
    "  )\n",
    ")\n",
    "\n",
    "print(results)\n"
   ]
