   "source": [
    "#В описании датасета написано, про дисбаланс классов. Вин со средней оценкой будет больше, чем плохих или хороших, бе\n",
    "library(tidyverse)\n",
    "library(caret)\n",
    "library(corrplot)\n",
    "\n",
    "# 1. Загрузка\n",
    "df <- read_csv(\"/kaggle/input/wine-quality-dataset/WineQT.csv\") # Или как там файл называется в Kaggle\n",
    "\n",
    "\n",
    "\n",
    "# 2. EDA: Распределение целевой переменной\n",
    "# Это ключевой график для понимания сложности задачи\n",
    "p1 <- ggplot(df, aes(x = factor(quality), fill = factor(quality))) +\n",
    "  geom_bar() +\n",
    "  labs(title = \"Распределение оценок качества вина\", x = \"Quality\", y = \"Count\")\n",
    "\n",
    "print(p1)\n",
    "\n",
    "# 3. Корреляция \n",
    "cor_matrix <- cor(df)\n",
    "corrplot(cor_matrix, method = \"color\", type = \"upper\", order = \"hclust\", \n",
    "         addCoef.col = \"black\", number.cex = 0.6) # Цифры помельче, чтобы влезли\n",
    "\n",
    "# 4. Подготовка к классификации\n",
    "\n",
    "df$quality <- factor(df$quality)\n"
   ]
  },
