   "source": [
    "library(tidyverse)\n",
    "library(caret)\n",
    "library(corrplot)\n",
    "\n",
    "# 1. Загрузка и EDA\n",
    "df <- read_csv(\"/kaggle/input/wine-quality-dataset/WineQT.csv\")\n",
    "if(\"Id\" %in% names(df)) df <- df %>% select(-Id)\n",
    "\n",
    "# Важно: делаем quality фактором для классификации\n",
    "df$quality <- factor(df$quality)\n",
    "\n",
    "# 2. Обучение моделей с 10-Fold CV\n",
    "set.seed(123)\n",
    "train_control <- trainControl(method = \"cv\", number = 10)\n",
    "\n",
    "# kNN\n",
    "model_knn <- train(quality ~ ., data = df, method = \"knn\", \n",
    "                   trControl = train_control, \n",
    "                   preProcess = c(\"center\", \"scale\"))\n",
    "\n",
    "# Random Forest\n",
    "model_rf <- train(quality ~ ., data = df, method = \"rf\", \n",
    "                  trControl = train_control)\n",
    "\n",
    "# Decision Tree (исправленный вызов)\n",
    "x <- df %>% select(-quality)\n",
    "y <- df$quality\n",
    "model_tree <- train(x = x, y = y, method = \"rpart\", \n",
    "                    trControl = train_control)\n",
    "\n",
    "# 3. Сравнение (Единственный честный результат)\n",
    "results <- resamples(list(kNN = model_knn, Tree = model_tree, RF = model_rf))\n",
    "\n",
    "# Вывод метрик (Accuracy, Kappa)\n",
    "summary(results)\n",
    "dotplot(results)\n"
   ]
  },
